import Login from "./components/login";
import ReactDOM from "react-dom/client";
import {BrowserRoutes, Route, Router,} from "lucide-react";


function App() {
  return (
    <div className="App">
      <BrowserRoutes>
      <Router>
        <Route path="/login" element={<Login/>}/>
     </Router>
     </BrowserRoutes>
    </div>
  );
}

export default App;
